public class InnerJobDefinitionContainerPropertiesFactory(Action<Humidifier.Batch.JobDefinitionTypes.ContainerProperties> factoryAction = null) : SubResourceFactory<Humidifier.Batch.JobDefinitionTypes.ContainerProperties>
{

    internal InnerJobDefinitionRepositoryCredentialsFactory RepositoryCredentialsFactory { get; set; }

    internal InnerJobDefinitionLinuxParametersFactory LinuxParametersFactory { get; set; }

    internal InnerJobDefinitionFargatePlatformConfigurationFactory FargatePlatformConfigurationFactory { get; set; }

    internal InnerJobDefinitionLogConfigurationFactory LogConfigurationFactory { get; set; }

    internal InnerJobDefinitionRuntimePlatformFactory RuntimePlatformFactory { get; set; }

    internal InnerJobDefinitionNetworkConfigurationFactory NetworkConfigurationFactory { get; set; }

    internal InnerJobDefinitionEphemeralStorageFactory EphemeralStorageFactory { get; set; }

    protected override Humidifier.Batch.JobDefinitionTypes.ContainerProperties Create()
    {
        var containerPropertiesResult = CreateContainerProperties();
        factoryAction?.Invoke(containerPropertiesResult);

        return containerPropertiesResult;
    }

    private Humidifier.Batch.JobDefinitionTypes.ContainerProperties CreateContainerProperties()
    {
        var containerPropertiesResult = new Humidifier.Batch.JobDefinitionTypes.ContainerProperties();

        return containerPropertiesResult;
    }
    public override void CreateChildren(Humidifier.Batch.JobDefinitionTypes.ContainerProperties result)
    {
        base.CreateChildren(result);

        result.RepositoryCredentials ??= RepositoryCredentialsFactory?.Build();
        result.LinuxParameters ??= LinuxParametersFactory?.Build();
        result.FargatePlatformConfiguration ??= FargatePlatformConfigurationFactory?.Build();
        result.LogConfiguration ??= LogConfigurationFactory?.Build();
        result.RuntimePlatform ??= RuntimePlatformFactory?.Build();
        result.NetworkConfiguration ??= NetworkConfigurationFactory?.Build();
        result.EphemeralStorage ??= EphemeralStorageFactory?.Build();
    }

} // End Of Class

